//
//AppLayout으로 감싸진 컴포넌트들이
//{children}으로  들어가서 화면을 출력해줌
const AppLayout = () => {
  return (
    <div>
      <div>공통메뉴</div>
      {children}
    </div>
  );
};
AppLayout.propTyps = {
  //children은 node의 타입(react)
  //화면에 그릴 수 있는 모든 것들이 node
  children: propTypes.node.isRequired,
};

export default AppLayout;
